import React from 'react'
import Project from './Project'
const List = () => {
    const projects = [
        {nombre: 'jorge'},
        {nombre: 'maria'},
        {nombre: 'no se'}
    ]
    return (
        <ul>
            {projects.map(project => {
                <Project project={project} />
            })}
        </ul>
    )
}

export default List
